// src/components/AddMaster.js
import React, { useState } from 'react';
import { useAuth } from '../context/AuthContext';
import Login from './Login';

const AddMaster = () => {
  const { isAuthenticated } = useAuth();
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [specialization, setSpecialization] = useState('');
  const [photo, setPhoto] = useState('');
  const [city, setCity] = useState('');
  const [service, setService] = useState('');
  
  const handleSubmit = (e) => {
    e.preventDefault();
    // Add master logic here
  };

  return (
    <div>
      {isAuthenticated ? (
        <div>
          <h2>Add Master</h2>
          <form onSubmit={handleSubmit}>
            <input type="text" placeholder="First Name" value={firstName} onChange={(e) => setFirstName(e.target.value)} />
            <input type="text" placeholder="Last Name" value={lastName} onChange={(e) => setLastName(e.target.value)} />
            <input type="text" placeholder="Specialization" value={specialization} onChange={(e) => setSpecialization(e.target.value)} />
            <input type="text" placeholder="Photo URL" value={photo} onChange={(e) => setPhoto(e.target.value)} />
            <input type="text" placeholder="City" value={city} onChange={(e) => setCity(e.target.value)} />
            <input type="text" placeholder="Service" value={service} onChange={(e) => setService(e.target.value)} />
            <button type="submit">Add Master</button>
          </form>
        </div>
      ) : (
        <Login />
      )}
    </div>
  );
};

export default AddMaster;
